  selectedViewType: 0
  name: Analytics Engineering Concepts
  author: Nodematic
  description: <p>Ideas:</p><ol><li>ELT pipelines over ETL</li><li>Take advantage
    of the technological innovation and scale of modern cloud data
    warehouses</li><li>Raw data, transformed data, and transformations are all
    in the data warehouse</li><li>Use source declarations to be most adaptable
    to source data changes and renames</li><li>Document data and transformations
    at multiple levels (e.g., table, column, and script)</li><li>Document once
    (single source of truth), but surface the documentation in all
    systems</li><li>Keep transformations relatively small and modular, for
    understandability and agility</li><li>Keep things simple with the DDL vs.
    DML, and skaffolding/boilerplate for derived data assets</li><li>Use
    directory structures to cleanly organize transformations</li><li>Use simple,
    built in assertions for basic, common validations</li><li>Use custom, manual
    asserts for more complex business logic</li><li>Use dependencies to ensure
    data is validated before it's used downstream</li></ol>
